// frontend/src/pages/TaskTrackingPage.js
import React, { useState, useEffect, useContext, useRef } from 'react';
import { useParams } from 'react-router-dom';
import { MapContainer, TileLayer, Marker, Popup, useMap } from 'react-leaflet';
import { Spinner, Alert, Badge } from 'react-bootstrap';
import L from 'leaflet';
import io from 'socket.io-client';

import taskService from '../services/taskService';
import AuthContext from '../context/AuthContext';
import './TaskTrackingPage.css';

const SOCKET_URL = 'http://localhost:5000';

// Fix for default marker icon
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: require('leaflet/dist/images/marker-icon-2x.png'),
  iconUrl: require('leaflet/dist/images/marker-icon.png'),
  shadowUrl: require('leaflet/dist/images/marker-shadow.png'),
});

const MapUpdater = ({ position }) => {
    const map = useMap();
    useEffect(() => {
        if (position) {
            map.flyTo(position, 15);
        }
    }, [position, map]);
    return null;
};

const TaskTrackingPage = () => {
    const { taskId } = useParams();
    const { token } = useContext(AuthContext);

    const [task, setTask] = useState(null);
    const [erranderPosition, setErranderPosition] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');
    const socketRef = useRef(null);

    useEffect(() => {
        // Fetch initial task details
        const fetchTaskDetails = async () => {
            if (!token) { setLoading(false); return; }
            try {
                const res = await taskService.getTaskDetails(taskId, token);
                setTask(res.data);
                // Set initial position if errander has one
                if (res.data.errander && res.data.errander.location) {
                    const { coordinates } = res.data.errander.location;
                    setErranderPosition([coordinates[1], coordinates[0]]);
                }
            } catch (err) {
                setError('Could not fetch task details.');
            } finally {
                setLoading(false);
            }
        };

        fetchTaskDetails();

        // Setup WebSocket connection
        socketRef.current = io(SOCKET_URL);
        socketRef.current.emit('joinTaskRoom', taskId);

        socketRef.current.on('locationUpdate', (location) => {
            const newPos = [location.latitude, location.longitude];
            setErranderPosition(newPos);
        });
        
        // Clean up on component unmount
        return () => {
            socketRef.current.disconnect();
        };
    }, [taskId, token]);
    
    if (loading) return <div className="text-center mt-5"><Spinner animation="border" /></div>;
    if (error) return <Alert variant="danger" className="m-4">{error}</Alert>;
    if (!task) return <Alert variant="warning" className="m-4">Task not found.</Alert>;

    const defaultPosition = erranderPosition || [-1.286389, 36.817223];

    return (
        <div className="tracking-container">
            <div className="tracking-header">
                <h3>Tracking Your Errand</h3>
                <p>Task Status: <Badge bg="primary" className="status-badge">{task.status.replace('_', ' ')}</Badge></p>
                {task.errander && <p>Your errander: <strong>{task.errander.firstName}</strong></p>}
            </div>
            <MapContainer center={defaultPosition} zoom={13} className="tracking-map-container">
                <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" />
                {erranderPosition && (
                    <Marker position={erranderPosition}>
                        <Popup>Your errander is here.</Popup>
                    </Marker>
                )}
                <MapUpdater position={erranderPosition} />
            </MapContainer>
        </div>
    );
};

export default TaskTrackingPage;
